import React from 'react'
import Card from './components/Card/Card';
import Bienvenido from './components/Bienvenido/Bienvenido.jsx'
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <div className='App'>
      <Routes>
        <Route path='/home' element={<Card/>} />
      </Routes>
    </div>
  );
}


export default App;
